import './styles/main.scss'

// Открытие бокового меню
document.addEventListener('DOMContentLoaded', function () {
    const burger = document.getElementById('burgerMenu');
    const tabletMenu = document.getElementById('tabletMenu');
    const mobileMenu = document.getElementById('mobileMenu');
    const overlay = document.getElementById('overlay');
    burger.addEventListener('click', () => {
        tabletMenu.classList.add('active');
        overlay.style.display = 'block';
    });

    // Открытие мобильного меню
    burger.addEventListener('click', () => {
        mobileMenu.classList.add('active');
        overlay.style.display = 'block';
    });

    // Закрытие меню и оверлея при нажатии на оверлей
    overlay.addEventListener('click', () => {
        tabletMenu.classList.remove('active');
        mobileMenu.classList.remove('active');
        overlay.style.display = 'none';
    });

});

// Загрузка карточек

const cardContainer = document.getElementById('cardBox');
const loadMoreButton = document.getElementById('loadMore');

let totalCards = 0;
const maxCards = 20;
const cardsToLoad = 5;


const images = [
    'data:image/png;base64,'
           
];



// Функция для загрузки карточек
async function fetchPosts() {
    const response = await fetch(`https://jsonplaceholder.typicode.com/posts?_limit=${cardsToLoad}&_start=${totalCards}`);
    const posts = await response.json();
    return posts;
}

function createCard(post) {
    const imageUrl = images[totalCards % images.length];
    const card = document.createElement('div');
    card.className = 'cards__item cards-item';
    card.innerHTML = `
        <img class="cards-item__img" src="${imageUrl}" alt="Money">
        <div class="cards-item__info">
            <h3 class="cards-item__title">${post.title}</h3>
            <p class="cards-item__text">${post.body}</p>
            <button class="cards-item__button">Continue reading</button>
        </div>
    `;
    return card;
}

async function loadCards() {
    if (totalCards >= maxCards) {
        loadMoreButton.style.display = 'none';
        return;
    }

    const posts = await fetchPosts();
    posts.forEach(post => {
        cardBox.appendChild(createCard(post));
    });

    totalCards += cardsToLoad;

    if (totalCards >= maxCards) {
        loadMoreButton.style.display = 'none';
    }
}

loadMoreButton.addEventListener('click', loadCards);

